                    <Target size={20} className="text-cyan-300" />
                    <span className="text-xs text-cyan-300">NEW TASK</span>
                  </div>
                  <div className="absolute inset-0 bg-cyan-300 opacity-0 group-hover:opacity-10 transition-opacity" />
